import Button from './Button'

const Header = ({ title, onSelect }) => {
  return (
    <header className = 'header'>
      <h1>{title}</h1>
      
      <Button onClick ={(e) =>onSelect} text = "Transcription" color ='black'/>
      <Button onClick ={(e) =>onSelect} text = "Handwriting Recognition" color ='black'/>
      <Button onClick ={(e) =>onSelect} text = "Voice Recognition" color ='black'/>
      
    </header>
  )
}

export default Header
